export default {
	status: '',
	uptime: '',
	course: '',
	config: '',
	ip: '',
	upstreams: [],
	downstreams: [],
	cpes: [],

	async runPollerAPI (mac = 'ee:ee:ee:00:00:00') {
		const response = await PollerAPI.run({'mac': mac});
		this.upstreams   = response.data.upstreams;
		this.downstreams = response.data.downstreams;
		this.cpes        = response.data.cpes;
		this.status      = 'onlinie';
		this.uptime      = response.data.uptime;
		this.course      = 'ネット120M';
		this.config      = 'net-120m.cfg';
		this.ip          = '172.16.0.100';
	},
	async copyDataToClipboard() {
		const str = InputMac.text + ' uptime is ' + Uptime.text + '.';
		// https://docs.appsmith.com/reference/appsmith-framework/widget-actions/copy-to-clipboard
		copyToClipboard(str);
	},
	async downloadData() {
		const str  = InputMac.text + ' uptime is ' + Uptime.text + '.';
		const filename = InputMac.text.replaceAll(':', '') + '.txt'
		// https://docs.appsmith.com/reference/appsmith-framework/widget-actions/download
		download(str, filename, "text/plain");
	},
	async runPing4API(ipv4) {
		const response = await Ping4API.run({'ipv4': ipv4});
		PingContent.setText(response.data.stdout);
		showModal("ModalPing");
	}
}

